import './App.css';
import { BrowserRouter, Routes, Route ,Link} from "react-router-dom";
import Slogin from './components/Slogin';
import Stlogin from './components/Stlogin';
function App() {
  return (
    <div className="App">
       <BrowserRouter>
      <Routes>
        <Route exact path="/" element={<Slogin />}>
        <Route exact path="/stafflogin" element={<Stlogin/>}/>
        </Route>
      </Routes>
    </BrowserRouter>
    </div>
  );
}

export default App;
